INSERT INTO `ec_commlog` (`lid`, `user`, `client`, `title`, `content`, `log_time`, `event_time`, `location`, `photo_url`) VALUES
(51, 'otto', '2', 'Inspection Meeting Records', '[Warehouse Inspection] <br/>\r\n<ol>\r\n<li>Inspection Guide (5-20 people)</li>\r\n<li>Wheel trap for heavy Truck</li>\r\n<li>Luke need renew his license</li>\r\n<li>Election of worker representative</li>\r\n<li>Online reading materials</li>\r\n<li>Safety Posters in Kitchen and Warehouse</li>\r\n<li>Safety Policy - a list of safety requirements</li>\r\n</ol>\r\n\r\n<p>note: there are 15 things need to be done with specific due dates, detail info refers to inspection report:</p>\r\n\r\n<a href =\"http://192.168.1.175/www/share/compliance.pdf\" target=\"_blank\"> compliance.pdf </a><br />\r\n<a href=\"http://192.168.1.175/www/share/report.pdf\"target=\"_blank\">report.pdf</a> <br/>', '2014-05-15 20:13:16', '2014-05-15 17:12:00', 'AGT office', ''),
(54, 'otto', '9', 'Payment due $ 5000', 'details regard to the bill', '2014-05-16 17:14:18', '2014-06-16 23:13:00', 'agt', ''),
(35, 'Boyao-Wang', '9', 'Meeting with Ryan', 'Meeting with Ryan and his new sale manager in their office. Bring a Hulk with off-road tires on it.', '2014-01-08 15:45:25', '2014-01-15 16:00:00', 'Bennett Office', ''),
(36, 'Boyao-Wang', '8', 'Meeting with Jeff', 'Meeting with Jeff, discuss the City of Ajax tender and new commission plan for Jeff.', '2014-01-08 15:47:23', '2014-01-09 13:45:00', 'Albion Office', ''),
(34, 'Boyao-Wang', '8', 'Ajax City Tender Deadline', 'I have contacted Jeff and ask him to follow up the city tender for electric UTV, he is going to follow up and give me feedback this week. The tender deadline is Jan 14th 2014.', '2014-01-06 19:07:43', '2014-01-14 14:00:00', '', ''),
(37, 'Otto-Lau', '17', 'New Truck', 'I have to follow up with David for the shipping status of the new truck.', '2014-01-08 16:09:57', '0000-00-00 00:00:00', '', ''),
(38, 'Boyao-Wang', '19', 'Dealership', 'They want us to contact them again around end of Feb, confirm the details of dealership agreement new price and delivery date. They said they are willing to buy 1 hobbit2+2 Black 1 Nomad Red, and we are going to give them 1 orange ramble and 1 sliver Hobbit 4+2. ', '2014-01-13 18:14:33', '0000-00-00 00:00:00', '', ''),
(39, 'Boyao-Wang', '20', 'Agro 14', 'Roger from seaspan is testing one of our agro 14 bus in Vancouver now. he is willing to buy 5 of them. we need to follow up with him.', '2014-01-23 21:38:49', '0000-00-00 00:00:00', '', ''),
(40, 'Boyao-Wang', '20', 'Hobbit 2H01', 'Vera Tatko from difference office of seaspan Vancouver is asking price of 3 hobbit 2H01. I have email her the price and spec list, waiting for the answer now.', '2014-01-23 21:40:38', '0000-00-00 00:00:00', '', ''),
(41, 'otto-lau', '4', '27/01/2014 Visiting', 'Topics Discussed:\r\n\r\nElectric Bike - \r\nMike may come to our office on next Wednesday to look at the New Arrival Bike.\r\n\r\nOpen House Event Planning - \r\nIn the month of MAY would be a good time to host open house event with Birdie Golf Cart\r\n\r\nOutstanding Balance Collecting Attempts - \r\nContact Mike by next Tuesday to follow up.', '2014-01-30 14:50:27', '0000-00-00 00:00:00', '', ''),
(42, 'otto-lau', '11', '27/01/2014 Visiting', 'Topics Discussed:\r\n\r\nOpen House Event - AGT is welcomed to join their open house event which will be held at the end of March/ beginning of April. (Same day with Duke)\r\n\r\nUpcoming Inventory planning - Glenn said that he has been working on his inventory planning for next up coming season, order requests will be placed if carts are needed from AGT.', '2014-01-30 14:55:27', '0000-00-00 00:00:00', '', ''),
(43, 'otto-lau', '21', '28/01/2014 Phone Call', 'Ron, the owner, shows no interest in golf cart nor off road cart. However, our new electric bike sparks his curiosity. Otterville shop is currently closed, will be re-open in late Feb or March.', '2014-01-30 15:24:09', '0000-00-00 00:00:00', '', ''),
(44, 'Boyao-Wang', '8', 'Jeff Meeting', 'Take a 2028-windshield, 20 catalogs ', '2014-02-03 19:41:54', '2014-02-04 16:00:00', 'Albion Office', ''),
(45, 'Boyao-Wang', '19', 'Price List', 'personal email abi@abibaba.ca before delivery on April 1st. ', '2014-03-03 19:54:00', '0000-00-00 00:00:00', '', ''),
(46, 'Boyao-Wang', '19', 'Delivery and meeting', 'Deliver the 4 cars they have ordered, and meet with Abi and his sales manager. ', '2014-03-25 18:06:18', '2014-04-04 18:00:00', 'Abibaba', ''),
(47, 'Boyao-Wang', '9', 'Pick up time for red 6+2 and Hulk', 'Ryan wants to pick up the red 6+2 and Hulk around April 23rd 2014', '2014-04-02 18:50:25', '0000-00-00 00:00:00', '', ''),
(48, 'Allen-Cai', '8', 'Payment Due', 'Payment due for $????', '2014-04-16 17:55:23', '2014-04-21 13:30:00', '', '');
